// import React from 'react';
import React, {Component} from 'react'
import './App.css';
import './index.css'
// import Card from 'react-bootstrap/Card';
import {Container, Row, Col, Card} from "react-bootstrap";

import axios from 'axios';
import Dashboard from './Dashboard';
import {useState, useEffect} from "react";

function App() {
    return (
            <Container>
                <div className="App">
                    {/*<div className="AppGlass">*/}
                        <Row>
                            <Col>
                                <div className="AppGlassCardTotal">
                                    <Card>
                                        <Card.Header as="h5">Featured</Card.Header>
                                        <Card.Body>
                                            <Card.Title>Special title treatment</Card.Title>
                                            <Card.Text>
                                                1000
                                            </Card.Text>
                                        </Card.Body>
                                    </Card>
                                    <Card>
                                        <Card.Header as="h5">Featured</Card.Header>
                                        <Card.Body>
                                            <Card.Title>Special title treatment</Card.Title>
                                            <Card.Text>
                                                1000
                                            </Card.Text>
                                        </Card.Body>
                                    </Card>
                                </div>
                            </Col>

                            <Col>
                                <div className="AppGlassCardMonthly">
                                    <Dashboard/>
                                </div>
                            </Col>
                            <Col>
                                <div className="AppGlassCardProgress">
                                    <Dashboard/>
                                </div>
                            </Col>
                            <Col>
                                <div className="AppGlassCardRevenue">
                                    <Dashboard/>
                                </div>
                            </Col>
                        </Row>
                    </div>
                {/*</div>*/}
            </Container>
    );
}

